package com.openmarket.entities;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import org.hibernate.Hibernate;import javax.persistence.*;import java.util.Objects;@Entity@Table(name = "shipping_partners")@Data@NoArgsConstructor@AllArgsConstructorpublic class ShippingPartner {    @SequenceGenerator(name = "admin_sequence_generator", allocationSize = 1, initialValue = 5000)    @Id    @GeneratedValue(generator = "admin_sequence_generator", strategy = GenerationType.SEQUENCE)    private Long shippingId;    private String companyName;    private String email;    @Override    public boolean equals(Object obj) {        ShippingPartner shipper = (ShippingPartner) obj;        if (this.companyName.equalsIgnoreCase(shipper.companyName)  ||             this.email.equalsIgnoreCase(shipper.email)) return true;       return false;    }    @Override    public int hashCode() {        int hash  = email.hashCode()+companyName.hashCode();        return hash;    }}